import Header from '../Header'
import UsersList from "../Users/usersList";

const Home = () => {

    return(
        <>
            <Header/>
            <Row center="xs" className="pageContent">
                        <UsersList/>
            </Row>
        </>
    )
}

export default withRouter(Home)
